import {
  Theme,
  createStyles
} from "@material-ui/core/styles";

const styles = (theme: Theme) => createStyles({
  root: {
    textAlign: 'center'
  },
  content: {
    padding: '10px 50px',
  },
  icon: {
    fontSize: 40,
    color: '#ED4C5C'
  },
  description: {
    color: '#111',

  }
})

export default styles
